import React from 'react'

class App extends React.Component{
  constructor() {
    super()
    this.state = {show: true}
  }

  clickme() {
    this.setState({hello: !this.state.hello})
  }

  render() {
    let message = ''
    if(this.state.show) {
      message = <p>Hello!!</p>
    }

    return <div>
      {message}
    </div>
  }
}

export default App;
